def compute_layer(prev, W, b):
    """Computes a layer in the neural network based on its W,b and previous layer"""
    n = len(b)
    cur = [0] * n
    for i in range(n):
        cur[i] = sum(W[j][i] * prev[j] for j in range(len(prev))) + b[i]
        if i != n - 1:
            cur[i] = max(0, cur[i])  # ReLU activation
        else:
            ...  # linear, could do softmax, but we are just taking argmax anyway
    return cur


def make_prediction(input_layer: list[int]) -> int:
    """Uses the model to make a prediction of what number it is"""
    layers = len(weights) // 2
    cur = input_layer
    for i in range(layers):
        cur = compute_layer(cur, weights[i * 2], weights[i * 2 + 1])
    return cur.index(max(cur))


def scale_down2(grid):
    """Scale down image by a factor of 2 (on each side), 4x total"""
    n = 28
    n2 = 14
    res = [[0] * n2 for _ in range(n2)]
    for i in range(n2):
        for j in range(n2):
            res[i][j] = 1 / 4 * (grid[i * 2][j * 2] + grid[i * 2 + 1][j * 2] + grid[i * 2][j * 2 + 1] + grid[i * 2 + 1][
                j * 2 + 1])
    return res


